classdef testReadingGmsh < testShowingError ...                         & testLoadStoredVariable ...                         & testStoredComputedChecker            properties (Access = protected)        tol = 1e-13;        testName = 'testReadingGmsh.mat'        variablesToStore = {'connec','coord',...                            'isElemInThisSet',...                            'masterSlave','corners'};    end              methods (Access = public, Static)                    function obj = testReadingGmsh()           filePath = 'tests/ReadingFilesTests/ReadingFiles/testReadingGmsh.msh';           reader = GmsReader(filePath);           obj.computedVar{1} = reader.connec;           obj.computedVar{2} = reader.coord;           obj.computedVar{3} = reader.isElemInThisSet{1};           obj.computedVar{4} = reader.masterSlave;           obj.computedVar{5} = reader.corners;        end            end    end